    <h1>{`Food and Blood Sugar`}</h1>
    <p>{`Food and Blood Sugar
What, how much and when you eat is very important for managing your blood sugar level. How does food affect my blood sugar? This section of the app will focus on two methods of meal planning – the Diabetes Plate and Carbohydrate Counting.`}</p>
    <p>{`Eating food is what gives us energy. Calories are energy and come from the amount of carbohydrate, protein, and fat that is found in food. Food also has water, vitamins, minerals, and antioxidants that do not give it calories, but provide other essential nutrients. Food works like the gas in your gas tank to give us energy.`}</p>
    <p>{`All foods turn into energy or glucose (blood sugar) but at different speeds. Some foods will break down and increase blood sugar more quickly than others. Foods contain a combination of nutrients. Foods with similar amounts of carbohydrate, protein, and fat are put into the same food groups.`}</p>
